import React, { useState } from 'react';
import { Parallax } from 'react-parallax';
import Video from '../../videos/video.mp4';
import GradPhoto from '../../images/MyPhoto.JPG';
import AwardPhoto from '../../images/Award.png';
import EducationPhoto from '../../images/Education.png'
import {
  HeroContainer,
  HeroWrapper,
  HeroBg,
  HeroVideoBg,
  Hero,
  HeroLeftCard,
  HeroPhotoIcon,
  HeroAwardIcon,
  HeroRight,
  HeroEducationIcon,
  HeroCardTop,
  HeroCardBottom,
  HeroH1,
  HeroH2,
  HeroH4
} from './HeroElements';

function HeroSection() {
  const [hover, setHover] = useState(false);

  const onHover = () => {
    setHover(!hover);
  };

  const Container = () => (
    <Parallax
        blur={{ min: -15, max: 15 }}
        bgImage={require('../../images/BackgroundPara.jpg')}
        bgImageAlt="the dog"
        strength={-200}
    >
        Blur transition from min to max
        <div style={{ height: '200px' }} />
    </Parallax>
);
  return (
    <HeroContainer id='hero'>
    <HeroBg>
      <HeroVideoBg playsInline autoPlay loop muted src={Video} type='video/mp4' />
    </HeroBg>
    <HeroWrapper>
    <Hero>
      <HeroLeftCard>
        <HeroPhotoIcon src={GradPhoto}></HeroPhotoIcon>
        <HeroH1>Isse H Nur</HeroH1>
      </HeroLeftCard>
      <HeroRight>
        <HeroCardTop>
          <HeroH2>Education</HeroH2>
          <HeroEducationIcon src={EducationPhoto}></HeroEducationIcon>
          <HeroH4>Degree: BS in Computer Science</HeroH4>
          <HeroH4>Date Graduated: December 15 2020</HeroH4>
        </HeroCardTop>
        <HeroCardBottom>
          <HeroH2>Awards</HeroH2>
          <HeroAwardIcon src={AwardPhoto}></HeroAwardIcon>
          <HeroH4>Phi Theta Kappa Honors Society</HeroH4>
        </HeroCardBottom>
      </HeroRight>
    </Hero>
    </HeroWrapper>
    </HeroContainer>
  );
}

export default HeroSection;
